import React, { Component } from 'react'
import { Table, Divider, Tag } from 'antd';


const columns = [
    {
        title: '销售类型',
        // dataIndex: 'name',
        // key: 'name',
        // render: text => <a>{text}</a>,
    },
    {
        title: '销售作物',
        // dataIndex: 'age',
        // key: 'age',
    },
    {
        title: '销售时间',
        // dataIndex: 'address',
        // key: 'address',
    },
    {
        title: '销售产量',
        
    },
    {
        title: '成本价',
        
    }
    ]

const data = [
    {
        key: '1',
        name: 'John Brown',
        age: 32,
        address: 'New York No. 1 Lake Park',
        tags: ['nice', 'developer'],
    }
]
class Sell extends Component{
    render(){
        return(
            <div className='APP'>
                <Table columns={columns} data={data}>
                </Table>
            </div>
        )
    }
}
export default Sell
